sql_command:
SELECT COUNT(DISTINCT c.customer_id)
FROM banking_new."Customers" AS c
JOIN banking_new."Cards" ON c.customer_id = banking_new."Cards".customer_id
WHERE expiration_date < CURRENT_DATE AND EXISTS (
    SELECT 1 FROM banking_new."Deposits" d WHERE d.customer_id = c.customer_id
);

SELECT COUNT(DISTINCT c.customer_id)
FROM banking_new."Customers" c
JOIN banking_new."Accounts" a ON c.customer_id = a.customer_id;

SELECT COUNT(DISTINCT c.customer_id)
FROM banking_new."Customers" c
JOIN banking_new."Deposits" d ON c.customer_id = d.customer_id;

SELECT COUNT(DISTINCT c.customer_id)
FROM banking_new."Customers" c
JOIN banking_new."Loans" l ON c.customer_id = l.customer_id;

SELECT COUNT(DISTINCT c.customer_id)
FROM banking_new."Customers" c
JOIN banking_new."Cards" cards ON c.customer_id = cards.customer_id;

SELECT COUNT(transactions.transaction_id)
FROM banking_new."Transactions" AS transactions
WHERE transactions.transaction_amount > (
    SELECT AVG(transaction_amount) FROM banking_new."Transactions"
);

SELECT COUNT(*)
FROM banking_new."Deposits"
WHERE balance > (
    SELECT AVG(balance)
    FROM banking_new."Deposits"
);

SELECT COUNT(*)
FROM banking_new."Transactions"
WHERE transaction_amount BETWEEN 100 AND 1000;

SELECT COUNT(loans.loan_id)
FROM banking_new."Loans" loans
WHERE loans.end_date < '2026-01-01';

SELECT COUNT(*)
FROM banking_new."Deposits"
WHERE EXTRACT(MONTH FROM end_date) - EXTRACT(MONTH FROM start_date) BETWEEN 6 AND 12;

SELECT COUNT(loans.loan_id)
FROM banking_new."Loans" AS loans
WHERE EXTRACT(MONTH FROM loans.end_date) - EXTRACT(MONTH FROM loans.start_date) BETWEEN 12 * 12 AND 24 * 12;

SELECT COUNT(transaction_id)
FROM banking_new."Transactions"
WHERE updated_at >= CURRENT_DATE - INTERVAL '1 week';

SELECT COUNT(deposit_id)
FROM banking_new."Deposits"
WHERE end_date >= CURRENT_DATE + INTERVAL '6 month';

SELECT COUNT(loans.loan_id)
FROM banking_new."Loans" AS loans
WHERE loans.interest_rate BETWEEN 0.03 AND 0.05;

SELECT COUNT(loans.loan_id)
FROM banking_new."Loans" loans
WHERE loans.interest_rate > 0.06;

SELECT COUNT(transaction_id)
FROM banking_new."Transactions"
WHERE transaction_amount BETWEEN 50 AND 200;

SELECT COUNT(deposit_id)
FROM banking_new."Deposits"
WHERE "Deposits"."start_date" > '2023-01-01';

SELECT COUNT(loans.loan_id)
FROM banking_new."Loans" loans
WHERE loans.end_date < '2025-01-01';

SELECT COUNT(loans.loan_id)
FROM banking_new."Loans" AS loans
WHERE EXTRACT(MONTH FROM loans.end_date) - EXTRACT(MONTH FROM loans.start_date) BETWEEN 6 AND 12;

SELECT COUNT(*)
FROM banking_new."Transactions"
WHERE "updated_at" >= NOW() - INTERVAL '30 days';

SELECT COUNT(deposit_id)
FROM banking_new."Deposits"
WHERE end_date >= CURRENT_DATE + INTERVAL '1 year';

SELECT COUNT(loans.loan_id)
FROM banking_new."Loans" AS loans
WHERE loans.interest_rate BETWEEN 0.04 AND 0.06;

SELECT COUNT(transaction_id)
FROM banking_new."Transactions"
WHERE transaction_date >= CURRENT_DATE - INTERVAL '6 months' AND transaction_amount > 500;

SELECT COUNT(loans.loan_id)
FROM banking_new."Loans" loans
WHERE loans.interest_rate > 7;

SELECT COUNT(*)
FROM banking_new."Transactions"
WHERE transaction_amount BETWEEN 1000 AND 5000;

SELECT COUNT(deposit_id)
FROM banking_new."Deposits"
WHERE "Deposits"."start_date" > '2022-01-01';

SELECT COUNT(loans.loan_id)
FROM banking_new."Loans" loans
WHERE loans.end_date < '2024-01-01';

SELECT COUNT(deposit_id)
FROM banking_new."Deposits"
WHERE end_date >= CURRENT_DATE + INTERVAL '3 month';

SELECT COUNT(loans.loan_id)
FROM banking_new."Loans" AS loans
WHERE loans.interest_rate BETWEEN 0.02 AND 0.04;

SELECT COUNT(*)
FROM banking_new."Transactions"
WHERE "transaction_date" >= CURRENT_DATE - INTERVAL '3 months' AND "transaction_amount" > 100;

SELECT COUNT(DISTINCT banking_new."Customers".customer_id)
FROM banking_new."Loans"
JOIN banking_new."Customers" ON banking_new."Loans".customer_id = banking_new."Customers".customer_id;

SELECT COUNT(DISTINCT banking_new."Customers".customer_id)
FROM banking_new."Customers"
JOIN banking_new."Deposits" ON banking_new."Customers".customer_id = banking_new."Deposits".customer_id;

SELECT SUM(banking_new."Deposits".balance) as total_deposit_balance
FROM banking_new."Customers"
JOIN banking_new."Deposits" ON banking_new."Customers".customer_id = banking_new."Deposits".customer_id;

SELECT AVG(banking_new."Deposits"."interest_rate") as average_deposit_interest_rate
FROM banking_new."Deposits"
JOIN banking_new."DepositTypes" ON banking_new."Deposits"."deposit_type_id" = banking_new."DepositTypes"."deposit_type_id";

SELECT COUNT(*)
FROM banking_new."Deposits"
WHERE end_date < CURRENT_DATE AND customer_id IS NOT NULL;

SELECT COUNT(*)
FROM banking_new."Deposits"
WHERE end_date IS NULL;

SELECT COUNT(loans.loan_id) as active_loans_count
FROM banking_new."Loans" loans
WHERE loans.end_date IS NULL;

SELECT COUNT(*)
FROM banking_new."Customers"
WHERE phone LIKE '%female%';

SELECT COUNT(*) as total_male_customers
FROM banking_new."Customers"
WHERE phone LIKE '%M%';

SELECT COUNT(customer_id)
FROM banking_new."Customers"
WHERE EXTRACT(YEAR FROM date_of_birth) > 1990;

SELECT COUNT(*)
FROM banking_new."Customers"
WHERE EXTRACT(YEAR FROM date_of_birth) < 1980;

SELECT COUNT(loans.loan_id)
FROM banking_new."Loans" loans
WHERE loans.balance < -10000;

SELECT COUNT(*) as total_deposits
FROM banking_new."Deposits"
WHERE balance < 5000;

SELECT COUNT(*)
FROM banking_new."Transactions"
WHERE "transaction_amount" > 1000;

SELECT COUNT(accounts.account_id) as account_count
FROM banking_new."Accounts" accounts
WHERE accounts.account_balance > 5000;

SELECT COUNT(loans.loan_id)
FROM banking_new."Loans" loans
WHERE loans.balance = 0;

SELECT COUNT(*)
FROM banking_new."Deposits"
WHERE balance > 20000;

SELECT COUNT(DISTINCT banking_new."Customers".customer_id)
FROM banking_new."Customers"
WHERE banking_new."Customers".address LIKE '%California%';

SELECT COUNT(DISTINCT banking_new."Customers".customer_id)
FROM banking_new."Customers"
WHERE banking_new."Customers".address LIKE '%Texas%';

SELECT COUNT(transaction_id)
FROM banking_new."Transactions"
WHERE EXTRACT(YEAR FROM transaction_date) = 2024;

SELECT COUNT(transaction_id)
FROM banking_new."Transactions"
WHERE EXTRACT(YEAR FROM transaction_date) = 2023;

SELECT COUNT(accounts.account_id)
FROM banking_new."Accounts" accounts
WHERE accounts.created_at < '2015-01-01';

SELECT COUNT(accounts.account_id)
FROM banking_new."Accounts" accounts
WHERE accounts.created_at > '2020-01-01';

SELECT COUNT(loans.loan_id)
FROM banking_new."Loans" loans
WHERE loans.end_date >= '2022-01-01' AND loans.end_date <= '2022-12-31';

SELECT COUNT(deposit_id)
FROM banking_new."Deposits"
WHERE start_date::DATE <= '2021-12-31' AND end_date::DATE >= '2021-01-01';

SELECT COUNT(customer_id)
FROM banking_new."Customers"
WHERE customer_name LIKE 'A%';

SELECT COUNT(DISTINCT banking_new."Customers".customer_id)
FROM banking_new."Customers"
WHERE SUBSTRING(banking_new."Customers".address FROM 1 FOR 5) = '90';

SELECT COUNT(loans.loan_id) as overdue_loans_count
FROM banking_new."Loans" loans
WHERE loans.end_date < CURRENT_DATE;

SELECT COUNT(loans.loan_id) as total_closed_loans
FROM banking_new."Loans" loans
WHERE loans.end_date < current_date;

SELECT COUNT(*) as active_deposits
FROM banking_new."Deposits"
WHERE end_date IS NULL;

SELECT COUNT(*) as total_closed_deposits
FROM banking_new."Deposits"
WHERE end_date < current_date;

SELECT COUNT(customer_id)
FROM banking_new."Customers"
WHERE EXTRACT(YEAR FROM "Customers"."created_at") = 2022;

SELECT COUNT(customer_id)
FROM banking_new."Customers"
WHERE EXTRACT(YEAR FROM "Customers"."created_at") = 2023;
